import React from "react";
import Car from "./Car.png";
const Navbar=()=>{
    return (
        <div style={{display:"flex",justifyContent:"space-between",backgroundColor:"greenyellow"}}>
            <img src={Car} alt="khsdbk,h"  style={{height:100,width:100}}/>
            <ul style={{ display:"flex",listStyle:"none",border:"solid 1px",gap:20 }}>
                <li>ACD</li>
                <li>A</li>
                <li>B</li>
            </ul>
        </div>
    )
}


export default Navbar;
